window.bookSummaryJSON = "<p><b><i>Pirates of the Caribbean </i></b><b>meets </b><b><i>The Mummy </i></b><b>in </b><b><i>Vengeance of the Pirate Queen, </i></b><b>a new standalone YA fantasy romance, set in the world of Tricia Levenseller's </b><b><i>Daughter of the Pirate King</i></b><b>.</b></p> <p>As an assassin working for the pirate queen, 18-year-old Sorinda is surprised when Alosa’s next task for her is not to kill a new target, but to captain a handpicked crew on a rescue mission. Unfortunately, her helmsman is 20-year-old Kearan. He might be talented, but Sorinda finds him a real pain in the arse. Sadly, there are few places on a ship to hide from an attentive and attractive man.<br> <br> As the crew of the <i>Vengeance</i> faces dangerous waters and deadly sea creatures, they accidentally awaken the King of the Undersea—a man only half-alive, who can control the dead. Their rescue mission quickly becomes a fight to save the world, but first, Sorinda must save herself from joining the watery undead. <br> <b><br> A Macmillan Audio production from Feiwel and Friends.</b></p>"; 
